import React, { Component } from 'react';
import './App.css';
import Logginn from "./components/Logginn";
import {OpprettKonto} from "./components/OpprettKonto";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link as Links,
  browserHistory
} from "react-router-dom";



class App extends Component{
  render(){
    return (
      <Router history={browserHistory}>
        <div className="App">
        <Logginn/>
      <Route path={"Don't have an account? Sign Up"} Component={OpprettKonto}/>

      </div>
      </Router>
    );
  }
}

export default App;
